import React, { useState } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from "@/components/ui/card";
import { Tabs, TabsList, TabsTrigger, TabsContent } from "@/components/ui/tabs";
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "@/components/ui/select";
import CurrentAQI from './components/CurrentAQI';
import ForecastAQI from './components/ForecastAQI';
import HistoricalAQI from './components/HistoricalAQI';

const App = () => {
  const [activeTab, setActiveTab] = useState('current');

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-blue-100 p-4 sm:p-8">
      <Card className="max-w-6xl mx-auto bg-white/80 backdrop-blur-sm">
        <CardHeader className="text-center">
          <CardTitle className="text-3xl font-bold bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">
            Delhi AQI Monitor
          </CardTitle>
        </CardHeader>
        <CardContent>
          <Tabs value={activeTab} onValueChange={setActiveTab} className="w-full">
            <TabsList className="w-full justify-center mb-8">
              <TabsTrigger value="current" className="flex-1">
                Current AQI
              </TabsTrigger>
              <TabsTrigger value="forecast" className="flex-1">
                Forecast AQI
              </TabsTrigger>
              <TabsTrigger value="historical" className="flex-1">
                Historical AQI
              </TabsTrigger>
            </TabsList>
            <TabsContent value="current">
              <CurrentAQI />
            </TabsContent>
            <TabsContent value="forecast">
              <ForecastAQI />
            </TabsContent>
            <TabsContent value="historical">
              <HistoricalAQI />
            </TabsContent>
          </Tabs>
        </CardContent>
      </Card>
    </div>
  );
};

export default App;
